/*Table structure for table `base_organ` */

CREATE TABLE `base_organ` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `org_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '机构名称',
  `org_level` bigint DEFAULT NULL COMMENT '行政级别',
  `region_id` bigint DEFAULT NULL COMMENT '区域id，1级机构为city ,2级机构为district',
  `org_parent_id` bigint DEFAULT NULL COMMENT '上级机构id',
  `points` text COMMENT '多边形经纬度坐标集合',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=418 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='机构范围表';

