/*Table structure for table `express_task_delivery` */

CREATE TABLE `express_task_delivery` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `order_id` bigint NOT NULL DEFAULT '0' COMMENT '订单id',
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '任务状态',
  `org_id` bigint NOT NULL DEFAULT '0' COMMENT '网点ID',
  `org_name` varchar(30) DEFAULT NULL COMMENT '网点名称',
  `courier_emp_id` bigint DEFAULT NULL COMMENT '快递员ID',
  `courier_name` varchar(30) DEFAULT NULL COMMENT '快递员名称',
  `estimated_end_time` datetime DEFAULT NULL COMMENT '预计完成时间',
  `start_delivery_time` datetime DEFAULT NULL COMMENT '实际开始时间',
  `delivered_time` datetime DEFAULT NULL COMMENT '完成时间',
  `is_rejected` varchar(2) DEFAULT NULL COMMENT '是否拒收运货',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=756 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='取件、派件任务信息表';

