/*Table structure for table `line_base_shift` */

CREATE TABLE `line_base_shift` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `line_id` bigint DEFAULT NULL COMMENT '线路id',
  `start_time` varchar(30) DEFAULT NULL COMMENT '班次开始时间',
  `driver1_emp_id` bigint DEFAULT NULL COMMENT '第一司机',
  `driver2_emp_id` bigint DEFAULT NULL COMMENT '第二司机',
  `truck_id` bigint DEFAULT NULL COMMENT '卡车',
  `pair_shift_id` bigint DEFAULT NULL COMMENT '配对班次(同一辆车一去一回的另一班次)',
  `is_enabled` varchar(20) NOT NULL DEFAULT '1' COMMENT '状态 0：禁用 1：正常',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1925 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='线路基本表';

