/*Table structure for table `order_info` */

CREATE TABLE `order_info` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `order_no` varchar(50) NOT NULL COMMENT '订单号',
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '订单状态',
  `collect_type` varchar(10) NOT NULL DEFAULT '0' COMMENT '取件类型，1为网点自寄，2为上门取件',
  `user_id` bigint DEFAULT NULL COMMENT '客户id',
  `receiver_complex_id` bigint DEFAULT NULL COMMENT '收件人小区id',
  `receiver_province_id` varchar(20) DEFAULT NULL COMMENT '收件人省份id',
  `receiver_city_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '收件人城市id',
  `receiver_district_id` varchar(20) DEFAULT NULL COMMENT '收件人区县id',
  `receiver_address` varchar(255) DEFAULT NULL COMMENT '收件人详细地址',
  `receiver_name` varchar(255) DEFAULT NULL COMMENT '收件人姓名',
  `receiver_phone` varchar(255) DEFAULT NULL COMMENT '收件人电话',
  `receive_location` varchar(30) DEFAULT NULL COMMENT '起始点经纬度',
  `sender_complex_id` bigint DEFAULT NULL COMMENT '发件人小区id',
  `sender_province_id` varchar(20) DEFAULT NULL COMMENT '发件人省份id',
  `sender_city_id` varchar(20) DEFAULT NULL COMMENT '发件人城市id',
  `sender_district_id` varchar(20) DEFAULT NULL COMMENT '发件人区县id',
  `sender_address` varchar(255) DEFAULT NULL COMMENT '发件人详细地址',
  `sender_name` varchar(255) DEFAULT NULL COMMENT '发件人姓名',
  `sender_phone` varchar(255) DEFAULT NULL COMMENT '发件人电话',
  `send_location` varchar(30) DEFAULT NULL COMMENT '发件人坐标',
  `payment_type` varchar(10) DEFAULT NULL COMMENT '支付方式',
  `cargo_num` int DEFAULT NULL COMMENT '货物个数',
  `amount` decimal(32,2) DEFAULT NULL COMMENT '金额',
  `estimate_arrive_time` datetime DEFAULT NULL COMMENT '预计到达时间',
  `distance` decimal(10,2) DEFAULT NULL COMMENT '距离，单位：公里',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9922 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='物流单表';

