/*Table structure for table `order_trace_log` */

CREATE TABLE `order_trace_log` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `order_id` bigint DEFAULT NULL COMMENT '订单编号',
  `trace_desc` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '进度描述',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `cur_task_id` bigint DEFAULT '0' COMMENT '来源快递任务id',
  `task_type` varchar(20) DEFAULT NULL COMMENT '任务类型:1  揽收 2 运输 3 中转 4派送 ',
  `charge_emp_id` bigint NOT NULL DEFAULT '0' COMMENT '负责人id',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `is_rollback` varchar(20) DEFAULT NULL COMMENT '是否回退中',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=55665 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='物流单追踪信息';

