/*Table structure for table `transport_task` */

CREATE TABLE `transport_task` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `shift_id` bigint DEFAULT NULL COMMENT '车次id',
  `line_id` bigint DEFAULT NULL COMMENT '路线id',
  `start_org_id` bigint NOT NULL DEFAULT '0' COMMENT '起始机构id',
  `start_org_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '起始机构名称',
  `end_org_id` bigint NOT NULL DEFAULT '0' COMMENT '目的机构id',
  `end_org_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '目的机构名称',
  `status` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '任务状态',
  `order_num` int DEFAULT NULL COMMENT '运单个数',
  `driver1_emp_id` bigint DEFAULT NULL COMMENT '司机1id',
  `driver1_name` varchar(10) DEFAULT NULL COMMENT '司机1名称',
  `driver2_emp_id` bigint DEFAULT NULL COMMENT '司机2id',
  `driver2_name` varchar(10) DEFAULT NULL COMMENT '司机2名称',
  `truck_id` bigint DEFAULT NULL COMMENT '卡车id',
  `truck_no` varchar(10) DEFAULT NULL COMMENT '卡车号牌',
  `actual_start_time` datetime DEFAULT NULL COMMENT '实际启动时间',
  `actual_end_time` datetime DEFAULT NULL COMMENT '实际到达时间',
  `actual_distance` decimal(16,2) DEFAULT NULL COMMENT '实际行驶距离',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=92486 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='运输任务表';

