/*Table structure for table `truck_info` */

CREATE TABLE `truck_info` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `team_id` bigint DEFAULT NULL COMMENT '所属车队id',
  `truck_no` varchar(50) DEFAULT NULL COMMENT '车牌号码',
  `truck_model_id` varchar(50) DEFAULT NULL COMMENT '型号',
  `device_gps_id` varchar(50) DEFAULT NULL COMMENT 'GPS设备id',
  `engine_no` varchar(200) DEFAULT NULL COMMENT '发动机编码',
  `license_registration_date` datetime DEFAULT NULL COMMENT '注册时间',
  `license_last_check_date` datetime DEFAULT NULL COMMENT '最后年检日期',
  `license_expire_date` datetime DEFAULT NULL COMMENT '失效事件日期',
  `picture_url` varchar(255) DEFAULT NULL COMMENT '图片信息',
  `is_enabled` tinyint NOT NULL DEFAULT '1' COMMENT '状态 0：禁用 1：正常',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=963 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='车辆信息表';

