/*Table structure for table `truck_model` */

CREATE TABLE `truck_model` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `model_name` varchar(10) DEFAULT NULL COMMENT '型号名称',
  `model_type` varchar(10) DEFAULT NULL COMMENT '类型',
  `model_no` varchar(40) DEFAULT NULL COMMENT '型号编码',
  `brand` varchar(10) DEFAULT NULL COMMENT '品牌',
  `truck_weight` decimal(10,2) DEFAULT NULL COMMENT '整车重量 吨',
  `load_weight` decimal(10,2) DEFAULT NULL COMMENT '额定载重 吨',
  `total_weight` decimal(10,2) DEFAULT NULL COMMENT '总质量 吨',
  `eev` varchar(10) DEFAULT NULL COMMENT '排放标准',
  `boxcar_len` decimal(10,2) DEFAULT NULL COMMENT '货箱长m',
  `boxcar_wd` decimal(10,2) DEFAULT NULL COMMENT '货箱宽m',
  `boxcar_hg` decimal(10,2) DEFAULT NULL COMMENT '货箱高m',
  `max_speed` bigint DEFAULT NULL COMMENT '最高时速 千米每时',
  `oil_vol` bigint DEFAULT NULL COMMENT '油箱容积 升',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `is_deleted` varchar(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb3;

