/*Table structure for table `truck_team` */

CREATE TABLE `truck_team` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(100) DEFAULT '' COMMENT '车队名称',
  `team_no` varchar(30) NOT NULL DEFAULT '' COMMENT '车队编号',
  `org_id` bigint NOT NULL DEFAULT '0' COMMENT '所属机构',
  `manager_emp_id` bigint DEFAULT NULL COMMENT '负责人',
  `create_time` timestamp NOT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` varchar(20) NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='车队表';

